import './TrackList.css';
import List from '@mui/material/List';
import Track from '../Track/Track';

function Tracklist({ tracks }) {
  return (
    <List className="tracklist">
      {tracks.map((track) => (
        <Track
          key={track.id}
          track={track}
          // You can also pass down other necessary props like isRemoval, onAdd, onRemove
        />
      ))}
    </List>
  );
}

export default Trackist;
